import React from "react";
// import {
//     BrowserRouter as Link
// } from "react-router-dom";
import "./App.css";


export default function SignUpPart2() {
    return (
        <div class="login-header">
            <h2>Complete Profile Info</h2>
            <input id="login-box" type="username" placeholder="new username" required>
            </input>
            <input id="login-box" type="password" placeholder="new password" required>
            </input>
            <button type="submit">Sign Up</button>
        </div>
    );
}
